import { useEffect, useState } from "react";
import axios from "axios";

function App() {
  const [isGreen, setIsGreen] = useState(true);
  return (
    <>
      <h3
        onClick={() => setIsGreen(!isGreen)}
        style={{ color: isGreen ? "green" : "orangered" }}
      >
        Text
      </h3>
    </>
  );
}

export default App;
